import React from "react";
import {
  BuyContainer,
  HeaderContainer,
  RentButton,
  RentContainer,
} from "./styles";

export default function Home() {
  return (
    <div>
      <HeaderContainer> Homestead</HeaderContainer>
      <RentContainer>
        Rent homes here
        <RentButton>Click to rent</RentButton>
      </RentContainer>
      <BuyContainer>Buy a home here</BuyContainer>
    </div>
  );
}
